{"reasoning":"Ground truth bug is about a helicopter that can stay airborne even though its rotor blades are not spinning. The presence of a character beneath the helicopter is incidental; the core issue is the motionless rotor while flying.

The generated report focuses on the character being suspended in mid-air from the helicopter without any rope or cable. It does not mention the rotor blades being motionless or any problem with the helicopter’s ability to fly. Instead, it frames the bug as a physics issue with the character, not an animation/physics issue with the helicopter rotor.

Because the primary symptom and root cause described differ (motionless rotor vs. unsupported hanging character), the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"The ground-truth bug is a very specific collision problem: after leaping onto another ship the avatar becomes frozen in mid-air beside the hull, keeps the falling animation, and after a short time drops into the water.  There is no mention of any on-screen error or desynchronization message.

The generated report instead speaks about a general "desynchronization" state in which the character is floating in the air with the "Desynchronizacja" warning, implying the game has detected a position/logic mismatch. It does not mention ships, jumping, being pinned to the ship’s side, continuous falling animation, or the subsequent fall into the water.  The visible symptom (avatar floating) is similar, but the context, trigger, and on-screen feedback are different, suggesting a different underlying issue.

Therefore the two reports do not describe the same bug.","match":false}

{"reasoning":"The ground-truth text only describes the visual situation: a white bird is flying while several arrows are flying (or floating) around it, and other birds are nearby. It does not state that the arrows are actually embedded in the bird, nor that there is anything wrong or unrealistic about the scene. 

The generated report, however, claims a physics bug: the arrows are embedded in the bird’s body yet the bird remains unaffected, calling this a “physics anomaly.” The presence of embedded arrows and the assertion that the bird should be impeded are key parts of the generated report but are absent from the ground truth. Conversely, the ground truth’s mention of multiple birds and arrows merely being around (not embedded) is not reflected in the generated report.

Because the core issue (a physics glitch with embedded arrows) described in the generated report is not present in the ground truth description, the two are not describing the same bug or even necessarily a bug at all.","match":false}

{"reasoning":"The ground truth bug concerns an aircraft resting on the water that, after an explosion, is violently projected upward with debris shapes that don’t correspond to the plane’s geometry. Key elements are: (1) object = plane on water, (2) abnormal upward launch, (3) debris pieces inconsistent with plane.

The generated report talks about a torpedo striking a ship where the explosion is too small and debris fails to spread realistically. Key elements are: (1) object = ship, (2) complaint about explosion size and debris dispersion, (3) no mention of object being launched or debris geometry mismatch.

Although both involve ‘unrealistic explosion/debris’, they describe different objects, different symptoms (plane catapulted vs. small explosion), and different specific issues. Therefore they do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth: when the player’s car hits an obstacle, a large number of small black, shard-shaped fragments are suddenly ejected upward. These are presumably graphical artifacts (black shards) that should not appear.

Generated report: on collision, normal car components (tyres, body panels) break off and then remain suspended/floating in mid-air. It describes legitimate car parts detaching and staying in the air rather than many black shards being explosively thrown upward.

Although both happen after a collision, the nature of the unintended objects is different (graphical black shards vs actual car parts), and the generated report emphasises the parts floating rather than being suddenly launched. These differences suggest they are distinct issues, not the same underlying bug.","match":false}

{"reasoning":"Ground truth bug concerns enemies: (1) an enemy caught in a web clips through a lamppost, (2) another enemy’s legs are unnaturally twisted, (3) a different enemy is launched into a truck and clips/moves inside it. All issues involve enemy models clipping or deforming after web/attack interactions.

Generated report instead says: (a) webbing does not securely hold an attached object, indicating a physics anomaly, and (b) the player character’s (Spider-Man’s) own movement/positioning looks unnatural. It does not mention enemies clipping through geometry, twisted limbs, or being projected inside vehicles. The focus is on web strength and Spider-Man animation, not on enemy clipping/deformation.

Because the described symptoms, actors affected, and nature of the anomaly differ, the two reports do not refer to the same underlying bug.","match":false}
